from typing import List

class Solution:
    def minOperations(self, nums: List[int], k: int) -> int:
        # We could iterate column-wise, find out XOR of all bits per column
        # and compare with the bit in that column of k. Or we can XOR all
        # elements of nums and then compare the result with k.
        x = 0
        for n in nums:
            x ^= n
        # We only need to see the total number of bit differences
        # between x and k. So do an XOR and return the bitcount of
        # the result
        res = x ^ k
        return bin(res).replace('0b','').count('1')

